insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Alergia', 'Las alergias, también llamadas reacciones de hipersensibilidad, son respuestas exageradas del sistema inmunológico (las defensas de nuestro organismo) al entrar en contacto con determinadas sustancias, llamadas alérgenos.', 'La mayoria de ellas consiste solo en la molestia que causa el lagrimeo y el picor en los ojos, ademas de algunos estornudos.', 'Antihistaminicos, Inmunoterapia');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Bronquitis', 'La bronquitis es el resultado de la inflamación de los conductos que transportan el aire al interior de los pulmones y de ellos de nuevo al exterior, para así llevar a cabo la respiración.', 'La bronquitis se manifiesta habitualmente con tos, mucosidad con salida oral y, en ocasiones dificultad respiratoria como consecuencia de la  reduccion del calibre de los bronquios. Puede acompañarse tambien, en ocasiones, de febricula, a partir de 37ºC, o fiebre, a partir de 38ºC.', 'Hidratacion, Atitermicos, Antibiotico, Inhaladores');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Leucemia', 'La leucemia es una enfermedad de la sangre en la que la médula ósea produce glóbulos blancos anómalos, denominados células blásticas leucémicas o células de leucemia.', 'Cansancio, perdida de apetito y de peso, fiebre , sudores nocturnos.', 'El tratamiento de la leucemia linfoblastica aguda suele basarse en la quimioterapia y se realiza en tres fases: de induccion de la remision, de consolidacion o intensificacion y de mantenimiento.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Infección Renal', 'Cuando las bacterias entran en sus riñones, pueden causar una infección. Las bacterias que causan infecciones renales por lo general vienen de otra parte de su tracto urinario, como la vejiga, los uréteres o la uretra.', 'Vomitos, Dolor en la espalda, los costados o la ingle, Escalofrios, Nauseas, Orinar a menudo, Sentir como si tuviera que orinar a menudo, incluso acabandolo de hacer, Dolor o ardor al orinar, Pus o sangre en la orina', 'Las infecciones renales se tratan con antibioticos. Es posible que su proveedor de atencion de salud le indique un medicamento antibiotico que trata los tipos mas comunes de infecciones');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Diabetes', 'La diabetes es una enfermedad en la que los niveles de glucosa (azúcar) de la sangre están muy altos.', 'Aumento de la sed y de las ganas de orinar, aumento del apetito, fatiga, vision borrosa, entumecimiento u hormigueo en las manos o los pies, ulceras que no cicatrizan, perdida de peso sin razon aparente', 'Algunas veces, ciertas medicinas pueden dañar las celulas beta o alterar el funcionamiento de la insulina. Estos incluyen: niacina, un tipo de vitamina B3, ciertos tipos de diureticos, medicinas anticonvulsivos y medicinas psiquiátricas');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Melanoma', 'El melanoma es un tipo de cáncer de piel que aparece cuando las células llamadas melanocitos se convierten en malignas.  Cuando la piel se expone al sol, los melanocitos producen más melanina como defensa contra la acción de los rayos ultravioleta (UV).', 'Las personas con una piel muy sensible que siempre se queman y nunca se broncean en su primera exposición constituyen un grupo de riesgo.', 'Cirugía: Es el tratamiento más común y consiste en la total extirpación del tumor junto a una parte del tejido sano que hay a su alrededor.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Neumonia', 'La neumonía es una infección en uno o en los dos pulmones caracterizada por la multiplicación de microorganismos en el interior de los alvéolos, lo que provoca que aparezca una inflamación con daño pulmonar.', 'Algunos casos debutan como una neumonía típica, que consiste en la aparición en varias horas o entre 2 y 3 días de tos con expectoración purulenta o herrumbrosa, en ocasiones con sangre, con dolor torácico y fiebre con escalofríos.', 'Una vez que diagnosticamos la neumonía se indica inmediatamente un tratamiento antibiótico. Cuando hay sospecha de que está presente el virus de la gripe se añade también un tratamiento antivírico (más habitual en invierno), el resto del año se trata con antibióticos');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Obesidad', 'La obesidad es una enfermedad crónica tratable que aparece cuando existe un exceso de tejido adiposo (grasa) en el cuerpo.', 'La acumulación del exceso de grasa debajo del diafragma y en la pared torácica puede ejercer presión en los pulmones, provocando dificultad para respirar y ahogo, incluso con un esfuerzo mínimo.', 'El abordaje de la obesidad debe hacerse de forma multidisciplinar incluyendo una buena alimentación, la práctica de ejercicio físico, el apoyo psicológico y el tratamiento farmacológico.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Conjuntivitis', 'La conjuntivitis es una inflamación de la conjuntiva, una membrana mucosa fina y transparente que cubre la superficie del ojo. Esta inflamación hace más visibles los vasos sanguíneos, dando al ojo un color rosado o rojizo.', 'Los síntomas de la conjuntivitis se reconocen de inmediato, ya que el ojo enrojece y lagrimea más. Asimismo, existe ardor y la sensación de tener un cuerpo extraño dentro del ojo.', 'Las causas que ocasionen la conjuntivitis influirán en su tratamiento. Para empezar, deben limpiarse los ojos, quitando las secreciones con un paño limpio, agua hervida tibia o suero fisiológico estéril. También suelen ser útiles las compresas frías sobre los párpados y los analgésicos.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Osteoporosis', 'La osteoporosis es una enfermedad sistémica esquelética que se caracteriza por una disminución de la masa ósea y un deterioro de la microarquitectura de los huesos, lo que supone un aumento de la fragilidad de los huesos y del riesgo de sufrir fracturas.', 'Durante años se ha conocido a la osteoporosis como la epidemia silenciosa debido a que esta patología no produce síntomas, aunque el dolor aparece cuando surge la fractura. Los especialistas señalan que algunas fracturas vertebrales pueden pasar desapercibidas puesto que no se producen síntomas.', 'La selección del tratamiento dependerá de las características del paciente. Los expertos recuerdan que para que sea eficaz debe seguirse de forma constante durante varios años. Los fármacos que se emplean en la actualidad para combatir la osteoporosis consiguen detener la resorción ósea y evitar la pérdida del mineral.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Pancreatitis', 'La pancreatitis es una inflamación del páncreas y puede ser aguda o crónica.', 'El síntoma principal de la pancreatitis es un dolor en el cuadrante superior izquierdo o medio del abdomen.', 'El tratamiento de la pancreatitis aguda es el régimen de hospitalización, ajustando el mismo a cada caso, intentando adelantarse a los acontecimientos que se puedan producir en el desarrollo de la afección.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Rinitis', 'La rinitis es un trastorno que afecta a la mucosa nasal y que produce estornudos, picor, obstrucción, secreciones nasales y, en ocasiones, falta de olfato.', 'La rinitis estacional aparece con la llegada del polen. Los afectados pueden notar en la nariz, el paladar, la parte posterior de la garganta y los ojos un picor que empieza de forma gradual o bruscamente.', 'Los expertos señalan que el tratamiento farmacológico debe adaptarse a los síntomas y a la gravedad de los mismos. En la actualidad, los más utilizados son los fármacos tópicos y los orales.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Sifilis', 'La sífilis es una infección de transmisión sexual (ITS) causada por la bacteria espiroqueta Treponema pallidum. Esta infección se manifiesta en la zona genital, los labios, la boca o el ano, entre otras zonas, y puede producirse tanto en hombres como en mujeres.', 'En la primera etapa de la enfermedad, aparece una llaga en la zona donde se originó el contagio. En la fase secundaria son comunes las erupciones en la piel e incluso la aparición de llagas en la boca, la vagina o el ano. La fase latente y avanzada comienza cuando los síntomas anteriores han desaparecido.', 'La sífilis puede tratarse con antibióticos. La duración del tratamiento dependerá de la magnitud de la enfermedad y de otros factores relacionados con la salud general del paciente.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Tos Ferina', 'La tos ferina es una enfermedad infecto-contagiosa aguda que afecta al aparato respiratorio. Su principal síntoma es tos violenta en accesos o paroxismos que puede dificultar la respiración.', 'Inicialmente las manifestaciones clínicas de la tos ferina son semejantes a los que aparecen con un resfriado común. Estos síntomas suelen aparecer cuando ha transcurrido una semana desde la exposición a la bacteria.', 'En los primeros días de la enfermedad los antibióticos pueden reducir los síntomas. Sin embargo, si el diagnóstico se realiza tarde, los antibióticos no serán tan efectivos.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Vasculitis', 'Las vasculitis hacen referencia a un grupo de enfermedades diversas que producen la inflamación de los vasos sanguíneos (arterias, arteriolas, capilares, vénulas y venas).', 'Las manifestaciones de las vasculitis pueden variar de forma. Pueden incluir síntomas generales, como cansancio, fiebre, náuseas o pérdida de peso.', 'Debido a la gran variedad de tipos de vasculitis, el tratamiento se debe individualizar. También es necesario considerar otros aspectos singulares del individuo afectado, como la edad u otras enfermedades, a la hora de determinar el tratamiento.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Botulismo', 'El botulismo es una enfermedad causada por la bacteria Clostridium botulinum, ésta puede entrar en el organismo debido a heridas o por ingerirla a través de alimentos. Además, esta afección es poco frecuente, pero puede llegar a ser mortal si no se trata rápidamente.', 'Fatiga intensa, Debilidad, Vertigo, Vision borrosa, Sequedad en la boca, Dificultad para hablar, Problemas al tragar, Vomitos, Diarrea, Estreñimiento e Inflamación abdominal.', 'Para combatir la toxina es necesario un medicamento que se conoce como antitoxina botulínica. Esta antitoxina se deberá administrar lo antes posible, ya que la rápida administración es eficaz para reducir las tasas de mortalidad.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Dengue', 'El dengue es una enfermedad producida por un virus de la familia de los flavivirus. El hombre es el hospedador y un mosquito del género Aedes es el vector que con su picadura produce la transmisión.', 'Fiebre alta, Nauseas y vomitos, Erupción en la piel, Sangre en las encias y en la nariz, Debilidad general, Dolor muscular y articular, Tos y Dolor de garganta.', 'En términos generales, el tratamiento para las formas benignas se hace con antiinflamatorios, antipiréticos y reposo. En las formas graves se repone el equilibrio electrolítico y si hay hemorragia puede precisarse una transfusión de sangre y el control del número de plaquetas.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Edema Pulmonar', 'Un edema pulmonar es una acumulación anormal de líquido en los pulmones que provoca dificultad respiratoria. Desde el punto de vista fisiopatológico.', 'El síntoma principal del edema pulmonar es la disnea (dificultad para respirar), ésta puede aparecer cuando el afectado está realizando ejercicio físico o, en los casos más graves, también puede aparecer en reposo. En esas ocasiones el paciente no soportará permanecer tumbado (ortopnea).', 'Disminuir la presión venocapilar. Mejorar la ventilación pulmonar administrando oxígeno y fármacos broncodilatadores. Y tratar la enfermedad que ha causado el desencadenamiento del edema pulmonar');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Faringitis', 'Es la inflamación de la garganta o faringe a menudo causada por una infección bacteriana o vírica. Provoca molestia, dolor o carraspera en esta zona, lo que a menudo da lugar a dificultades al tragar o hablar.', 'El principal síntoma de esta afección es el dolor de garganta, aunque también existen otros secundarios.', 'Si el dolor de garganta está causado por una infección bacteriana, el especialista suele recetar un tratamiento con antibióticos. De este tipo de medicamentos el más comúnmente administrado es la penicilina (penicilina G, penicilina benzatina o amoxicilina) por vía oral durante 10 días.');
insert into Patologia (nombre, descripcion, sintomas, tratamiento) values ('Linfoma', 'Un linfoma es una proliferación maligna de linfocitos (células defensivas del sistema inmunitario), generalmente dentro de los nódulos o ganglios linfáticos, pero que a veces afecta también a otros tejidos como el hígado o el bazo.', 'Los linfomas se presentan como ganglios linfáticos aumentados de tamaño que, cuando aparecen en zonas accesibles como el cuello, las axilas o la ingle se pueden palpar evidenciando su tamaño aumentado. Estos bultos (adenopatías) no suelen ser dolorosos.', 'Los tratamientos más empleados han sido, tradicionalmente, los siguientes: Poliquimioterapia, Radio-quimioterapia y Trasplante de progenitores hematopoyéticos.');
insert into MedidaSanitaria (nombre, descripcion) values ('Evitar contacto con enfermos', 'Evitar el contacto cercano con personas que estan enfermas.');
insert into MedidaSanitaria (nombre, descripcion) values ('Evitar tocarse la cara', 'Evitar tocarse los ojos, la nariz y la boca.');
insert into MedidaSanitaria (nombre, descripcion) values ('Quedarse en casa', 'Quedarse en casa cuando presente sintomas (fiebre, tos, congestion nasal, dolor de garganta) relacionados con esta enfermedad.');
insert into MedidaSanitaria (nombre, descripcion) values ('Cubrirse al toser', 'Cubrirse cuando tose o estornude con un pañuelo desechable, luego tirelo a la basura.');
insert into MedidaSanitaria (nombre, descripcion) values ('Protocolo de estornudo', 'Utilizar el protocolo de estornudo en caso de que no cuente con pañuelos desechables.');
insert into MedidaSanitaria (nombre, descripcion) values ('Limpiar y desinfectar objetos y superficies', 'Limpiar y desinfecter los objetos y las superficies que se tocan con frecuencia con un spray desinfectante, con alcohol o paño de limpieza doméstico.');
insert into MedidaSanitaria (nombre, descripcion) values ('Lavarse las manos', 'Lavarse las manos a menudo con agua y jabon durante al menos 20 segundos, especialmente despues de ir al baño; antes de comer y despues de sonarse la nariz, toser o estornudar.');
insert into MedidaSanitaria (nombre, descripcion) values ('Usar desinfectante a base de alcohol', 'Si no hay agua y jabon disponibles, usar un desinfectante para manos a base de alcohol de un grado de al menos 70º.');
insert into MedidaSanitaria (nombre, descripcion) values ('Lavar manos visiblemente sucias', 'Siempre lavarse las manos con agua y jabon si las manos estan visiblemente sucias.');
insert into MedidaSanitaria (nombre, descripcion) values ('Mantenerse informado', 'Informarse de fuentes oficiales y no difundir informacion falsa o de fuentes no confiables.');
insert into MedidaSanitaria (nombre, descripcion) values ('Equipar instalaciones', 'Equipar las instalaciones y servicios sanitarios con: papel higienico, agua potable, jabon anti bacterial para lavado de manos, alcohol en gel y toallas de papel para el secado de manos.');
insert into MedidaSanitaria (nombre, descripcion) values ('Limpiar areas comunes', 'Limpiar y desinfectar las areas comunes (pisos, paredes, sillas, bancas, mesas, perillas de las puertas).');
insert into MedidaSanitaria (nombre, descripcion) values ('Oficinas ventiladas', 'Mantener las oficinas y los lugares donde se realizan las actividades bien ventilados, sin crear corrientes bruscas de aire.');
insert into MedidaSanitaria (nombre, descripcion) values ('No visitar enfermos', 'No visitar personas enfermas o con sintomas de gripe o resfrio.');
insert into MedidaSanitaria (nombre, descripcion) values ('Servicios de alimentacion con buenas practicas', 'Los servicios de alimentacion al publico deben garantizar la implementacion de las buenas practicas higienicas y de inocuidad.');
insert into MedidaSanitaria (nombre, descripcion) values ('No realizar ejercicio con fiebre', 'No realizar ejercicio físico si tiene fiebre, tos o dificultad para respirar.');
insert into MedidaSanitaria (nombre, descripcion) values ('Respetar distanciamiento social', 'Al salir a un espacio publico abierto para caminar, correr o hacer ejercicio, respetar siempre el distanciamiento físico de 1,8 metros entre usted y otras personas con las que no convive.');
insert into MedidaSanitaria (nombre, descripcion) values ('Cambiar calzado en casa', 'Al regresar a casa, cambiar o retirar del todo su calzado para evitar contaminacion.');
insert into MedidaSanitaria (nombre, descripcion) values ('Practica de deportes sin acompañantes', 'La practica de deportes en modalidad individual debera ser realizada sin acompañantes que no practiquen dicha actividad.');
insert into MedidaSanitaria (nombre, descripcion) values ('Medios electronicos de pago', 'Promover el uso de medios electronicos de pago, para evitar el uso de dinero en efectivo.');
insert into MedidaSanitaria (nombre, descripcion) values ('Evitar aglomeraciones', 'Vigilar para que durante la estadia no se den aglomeraciones de personas en puntos de encuentro comun y que se acaten las disposiciones vigentes.');
insert into MedidaSanitaria (nombre, descripcion) values ('Colocar rotulacion', 'Colocar rotulación en espacios visibles sobre temas de prevencion.');
insert into MedidaSanitaria (nombre, descripcion) values ('Usar mascarilla', 'Usar mascarilla (quirurgica, descartable, buen estado y utilizada correctamente) en los sitios de atencion al publico en fronteras, estacionamientos/parqueos y sitios de descanso, y todo lugar de reunion temporal.');
insert into MedidaSanitaria (nombre, descripcion) values ('Utilizar alternativas para saludar', 'Utilizar formas alternativas de saludar que no impliquen el contacto físico.');
insert into MedidaSanitaria (nombre, descripcion) values ('Empleados con proteccion personal', 'Proporcionar equipo de proteccion personal (guantes, mascarillas, etc.) asi como geles desinfectantes para uso de los empleados y choferes durante sus trayectos nacionales e internacionales.');
insert into MedidaSanitaria (nombre, descripcion) values ('Informar clientes', 'Proporcionar informacion a los clientes por diferentes medios sobre las medidas que estan implementando para minimizar el riesgo.');
insert into MedidaSanitaria (nombre, descripcion) values ('Evitar compartir utencilios', 'Evitar compartir utensilios u objetos de uso personal.');
insert into MedidaContencion (nombre, descripcion) values ('Analisis en aeropuertos', 'Analisis de personas al ingresar al pais por medio de aeropuertos.');
insert into MedidaContencion (nombre, descripcion) values ('Cancelacion de eventos masivos', 'Cancelacion de eventos y actividades de concentracion masiva, como conciertos y espectaculos publicos.');
insert into MedidaContencion (nombre, descripcion) values ('Cierres a centros educativos', 'Cierres preventivos a centros educativos en riesgo.');
insert into MedidaContencion (nombre, descripcion) values ('Reduccion en 50% de capacidad', 'Reducción en 50% de la capacidad aprobada de espacios de reunion publica.');
insert into MedidaContencion (nombre, descripcion) values ('Suspension de viajes al extranjero', 'Suspensión de viajes al extranjero para empleados publicos.');
insert into MedidaContencion (nombre, descripcion) values ('Cierre total de bares y discotecas', 'Cierre total de bares, discotecas y casinos.');
insert into MedidaContencion (nombre, descripcion) values ('Cierre total de parques de atracciones', 'Cierre total de parques de atracciones.');
insert into MedidaContencion (nombre, descripcion) values ('Aislamiento al ingresar al pais', 'Medidas de aislamiento obligatorio a quienes ingresan al pais seran aplicadas por orden sanitaria.');
insert into MedidaContencion (nombre, descripcion) values ('Suspencion de lecciones', 'Suspender lecciones, en los centros educativos publicos y privados y centros de formacion.');
insert into MedidaContencion (nombre, descripcion) values ('Ingreso solo de nacionales y residentes', 'En el caso de los vuelos, solo podran ingresar al pais los nacionales y residentes. Aplica por via maritima, aerea y terrestre.');
insert into MedidaContencion (nombre, descripcion) values ('Aplicar teletrabajo', 'Aplicar teletrabajo.');
insert into MedidaContencion (nombre, descripcion) values ('Operativos policiales', 'Operativos policiales en todo el territorio nacional para velar por el cumplimiento de medidas sanitarias.');
insert into MedidaContencion (nombre, descripcion) values ('Cines y teatros cerrados', 'Cines y teatros cerrados.');
insert into MedidaContencion (nombre, descripcion) values ('Centros comerciales al 50%', 'Los centros comerciales deberán trabajar al 50% de su capacidad.');
insert into MedidaContencion (nombre, descripcion) values ('Cierre total de playas', 'Cierre total de las playas en todo el pais.');
insert into MedidaContencion (nombre, descripcion) values ('Cierre de templos y cultos religiosos', 'Cierre obligatorio de templos y cultos religiosos.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion vehicular de 10p.m. a 5a.m.', 'Restriccion vehicular sanitaria de 10p.m. a 5a.m. Quienes incumplan restriccion se exponen a una multa economica.');
insert into MedidaContencion (nombre, descripcion) values ('Perdida de estatus migratorio al abandonar territorio', 'Todo extranjero residente o con estatus regular en el pais que abandone el territorio nacional, pierde automaticamente su estatus migratorio.');
insert into MedidaContencion (nombre, descripcion) values ('Cancelado uso de areas comunes en condominios', 'En residenciales y condominios se cancela el uso de areas comunes como: casaclub, azoteas, piscina, jacuzzi, gimnasios, canchas multiusos, ranchos, sala de eventos, entre otros.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion vehicular nocturna de 5p.m. a 5a.m.', 'Restriccion vehicular nocturna de 5:00 pm a 5:00 am.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion transporte publico', 'Se restringe el transporte publico de larga distancia.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion de circulacion', 'Se restringe la circulacion de vehiculos y transporte publico, salvo excepciones.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion total al transito con excepciones', 'Restricción total al transito vehicular con las siguientes excepciones: acceso a supermercados, abastecedores, farmacias y centros de salud, sin restricción horaria.');
insert into MedidaContencion (nombre, descripcion) values ('Deportes profesionales restringidos', 'Practica de deportes profesionales restringida.');
insert into MedidaContencion (nombre, descripcion) values ('Restricción vehicular con distribucion de placas', 'Restriccion vehicular de 5 a.m. a 7 p.m, con distribucion de placas.');
insert into MedidaContencion (nombre, descripcion) values ('Transporte publico regulado', 'Transporte publico regular será desde 4:00 am hasta 11:00 pm.');
insert into MedidaContencion (nombre, descripcion) values ('Cierre del transporte internacional', 'Cierre del transporte internacional de personas por via terrestre y las restricciones migratorias.');
insert into MedidaContencion (nombre, descripcion) values ('Establecimientos funcionando de :00 am a 7:00 pm', 'Establecimientos con permiso de funcionamiento y que atiendan al público, podran funcionar de 5:00 am a 7:00 pm; fines de semana unicamente servicio a domicilio y autoservicio.');
insert into MedidaContencion (nombre, descripcion) values ('Dos servicios de ferry', 'El servicio de ferry funcionaran únicamente dos servicios al día.');
insert into MedidaContencion (nombre, descripcion) values ('Establecimientos abiertos entre semana', 'Cines, lugares para practica o entrenamiento de deportes sin contacto, gimnasios y escuelas de natacion podran abrir establecimientos entre semana bajo ciertas condiciones.');
insert into MedidaContencion (nombre, descripcion) values ('Salones de belleza y barberias al 50%', 'Los salones de belleza y barberias, con un aforo al cincuenta por ciento (50%) segun capacidad maxima y unicamente con cita previa.');
insert into MedidaContencion (nombre, descripcion) values ('Accesorios para vehiculos al 50%', 'Venta al por menor de partes, piezas y accesorios para vehículos automotores y motocicletas, con un aforo al cincuenta por ciento (50%) segun capacidad maxima de ocupacion.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion de navegacion en rios', 'Restriccion de navegacion en rios, exceptuando actividades productivas y pesqueras, debidamente comprobadas por las autoridades competentes.');
insert into MedidaContencion (nombre, descripcion) values ('Restriccion por placas en fines de semana', 'Los fines de semana solo podra circularse por placas pares e impares para trasladarse a supermercados, farmacias, abastecedores y servicios de salud.');
insert into MedidaContencion (nombre, descripcion) values ('Personas sentadas unicamente en autobuses', 'No se permiten en autobuses personas de pie.');
insert into MedidaContencion (nombre, descripcion) values ('Cierre de establecimientos con permiso', 'Se cierran establecimientos con permiso sanitario de funcionamiento y atencion a publico presencial, se permiten los servicios a domicilio.');
